// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

import "@openzeppelin/contracts-upgradeable/token/ERC721/ERC721Upgradeable.sol";

contract Buy {
    // 
    enum GoodStatus {
        UnKown,     // ; 
        OnSale,     // ; 
        Canceled,   // 1: (); 
        HasOpened   // 2: ; 
    }

    // 
    struct OrderItem {
        address user;   // 
        uint256 id;     // ID
        uint256 amount; // /_min, _min
        uint256 min;    // 
        uint256 max;    //  max = base + (min + amount - 1)
    }

    address _owner;

    // 
    mapping (address => bool) _isWhite;
    address[] _whiteAddrList; 

    // 
    uint256 _goodCount; // 
    mapping (uint256 => GoodStatus) public _goodStatus;

    // id=>
    mapping (uint256 => uint256) public _baseNumber; // 1

    // 
    mapping (uint256 => OrderItem[]) private _orderByGoodID;

    // 
    mapping (address => OrderItem[]) private _orderByUser;

    // 
    mapping (address => uint256) _userRollback;

    //  
    uint256 _per; // wei

    constructor () {
        _per = 1 * (10**15); // 0.001ETH, wei
        _owner = msg.sender;
        _isWhite[_owner] = true;
        _whiteAddrList.push(msg.sender);
    }

    modifier onlyOwner() {
        require(msg.sender == _owner);
        _;
    }

    /*
    1 
    */
    // 
    function getStatus(uint256 id) public view returns (GoodStatus) {
        return _goodStatus[id];
    }

    // / 
    function setGoodStatus(uint256 id, GoodStatus state) public returns (bool) {
        require(_isWhite[msg.sender]);
        if (_goodStatus[id] == GoodStatus.HasOpened)
            return false;

        if (GoodStatus.OnSale == state) // 
            _goodCount ++;

        _goodStatus[id] = state;

        return true;
    }

    // 
    function getNumberByGoodID(uint256 id) public view returns (uint256) {
        return _baseNumber[id];
    }

    // ; TODO 
    function openLotty(uint256 random, uint256 id, uint256 tokenId, address contractAddr) public returns (uint256, address) {
        require(_isWhite[msg.sender]);
        if (GoodStatus.OnSale != _goodStatus[id] && _baseNumber[id] > 0) // 
            return (0, address(0x00));
        _goodStatus[id] = GoodStatus.HasOpened;

        uint256 luckyNO = ((random + block.number) % _baseNumber[id]) + 1;
        address lucyUser = address(0x00);

        OrderItem[] memory tmpOrder = _orderByGoodID[id];
        uint256 orderCount = tmpOrder.length;

        // find lucky user
        for (uint256 i = 0; i < orderCount; i++) {
            if (luckyNO >= tmpOrder[i].min && luckyNO <= tmpOrder[i].max) {
                lucyUser = tmpOrder[i].user;

                // transfer NFT
                ERC721Upgradeable(contractAddr).safeTransferFrom(msg.sender, lucyUser, tokenId);
                break;
            }
        }

        return (luckyNO, lucyUser);
    }

    // 
    function buy(uint256 id) public payable returns (bool) {
        require(GoodStatus.OnSale == _goodStatus[id] && msg.value >= _per); // TODO 

        uint256 amount = msg.value / _per; // 
        OrderItem memory order;
        order.amount = amount;
        order.id     = id;
        order.user   = msg.sender;
        order.min    = _baseNumber[id] + 1;
        order.max    = order.min + amount - 1;
        _baseNumber[id]  = order.max;

        _orderByUser[msg.sender].push(order);
        _orderByGoodID[id].push(order);

        return true;
    }

    // 
    function rollBack() public {
        uint256 money;
        uint256 rollbackPoint = _userRollback[msg.sender];

        for (uint256 i = 0; i >= rollbackPoint && i < _goodCount; i++) {
            if (GoodStatus.Canceled == _goodStatus[i] && isInOrder(msg.sender, i)) { // 
                money += getAmount(msg.sender, i);
            }
        }

        if (money > 0) {
            _userRollback[msg.sender] = _goodCount;
            payable(msg.sender).transfer(money);
        }

    }

    // 
    function isInOrder(address user, uint256 id) public view returns (bool) {
        for (uint256 i = 0; i < _orderByUser[user].length; i ++)
            if (id == _orderByUser[user][i].id)
                return true;

        return false;
    }

    /*
    2 
    */
    // 
    function whitdraw(address to, uint256 amount) public onlyOwner {
        if (amount > address(this).balance)
            return;
        payable(to).transfer(amount); //  wei
    }

    // 
    function add2WhiteList(address user) public onlyOwner returns (bool){
        if (_isWhite[user])
            return false;
        _isWhite[user] = true;
        _whiteAddrList.push(user);
        return true;
    }

    // 
    function setPer(uint256 per) public {
        if (per >0 )
            _per = per;
    }

    /*
    3 
     */
    // 
    function getOrder() public view returns (OrderItem[] memory) {
        return _orderByUser[msg.sender];
    }

    // 
    function getOrderByGoodID(uint256 id) public view returns (OrderItem[] memory){
        return _orderByGoodID[id];
    }

    // 
    function getAmountByGoodID(uint256 id) public view returns (uint256){
        uint256 amount;
        for (uint256 i = 0; i < _orderByGoodID[id].length; i ++)
            amount += _orderByGoodID[id][i].amount;
        return amount * _per;
    }

    // ()
    function calProfit(uint256 maxId) public view returns (uint256) {
        uint256 amount;
        for (uint256 i = 0; i < maxId + 1 && i < _goodCount; i++) {
            if (GoodStatus.HasOpened != _goodStatus[i])
                continue;
            for (uint256 k = 0; k < _orderByGoodID[i].length; k++) {
                amount += _orderByGoodID[i][k].amount;
            }
        }

        return amount * _per;
    }

    // 
    function getAmount(address user, uint256 id) public view returns (uint256) {
        uint256 amount;
        for (uint256 i = 0; i < _orderByUser[user].length; i ++)
            if (id == _orderByUser[user][i].id)
                amount += _orderByUser[user][i].amount;

        return amount * _per;
    }

    // 
    function getPer() public view returns (uint256) {
        return _per;
    }

    // 
    function getWhiteList() public view returns (address[] memory) {
        return _whiteAddrList;
    }

    // , [0, (_goodCount -1)]key(ID)
    function getGoodsCount() public view returns (uint256) {
        return _goodCount;
    }

}
